import React from 'react';
import dumbbellImg from './dumbbell.png';

const DumbbellBackground = () => {
  const dumbbells = [];
  const rows = 30;
  const cols = 60;
  const spacing = 50;

  for (let row = 0; row < rows; row++) {
    for (let col = 0; col < cols; col++) {
      const offsetX = row % 2 === 0 ? 0 : spacing / 2;
      dumbbells.push({
        id: `${row}-${col}`,
        top: row * spacing,
        left: col * spacing + offsetX - spacing * 2,
      });
    }
  }

  return (
    <>
      <style>{`
        @keyframes scrollRight {
          0% {
            transform: translateX(-${spacing}px);
          }
          100% {
            transform: translateX(0);
          }
        }

        .dumbbell-container {
          animation: scrollRight 3s linear infinite;
        }
      `}</style>

      <div className="dumbbell-container absolute inset-0">
        {dumbbells.map((dumbbell) => (
          <img
            key={dumbbell.id}
            src={dumbbellImg}
            alt="dumbbell"
            className="absolute w-8 h-8 object-contain opacity-30"
            style={{
              top: `${dumbbell.top}px`,
              left: `${dumbbell.left}px`,
              transform: 'rotate(45deg)',
              filter: 'brightness(0.5) contrast(1.2)',
            }}
          />
        ))}
      </div>

      <div className="dumbbell-container absolute inset-0" style={{ transform: `translateX(${spacing}px)` }}>
        {dumbbells.map((dumbbell) => (
          <img
            key={`dup-${dumbbell.id}`}
            src={dumbbellImg}
            alt="dumbbell"
            className="absolute w-8 h-8 object-contain opacity-30"
            style={{
              top: `${dumbbell.top}px`,
              left: `${dumbbell.left}px`,
              transform: 'rotate(45deg)',
              filter: 'brightness(0.5) contrast(1.2)',
            }}
          />
        ))}
      </div>
    </>
  );
};

export default DumbbellBackground;
